import React from "react";
import { HeikinAshi } from "recharts";
import heikinAshiChartData from "./HeikinAshiData.json";

const HeikinAshiChartComponent = () => {
  return (
    <HeikinAshi width={500} height={300} data={heikinAshiChartData} />
  );
};

export default HeikinAshiComponent;
